// App.js

import React, { useContext } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Home from './containers/public/signin/SignIn';
import Register from './containers/public/signup/SignUp';
import { NotesContainer } from './containers/Dashboard';
import Navbar from './components/navbar/Navbar';
import { Nomatch } from './containers/no-match/Nomatch';

import { AuthContext } from './utils/auth'; // Assuming AuthContext is provided by AuthProvider

const App = () => {
  const authContext = useContext(AuthContext);
  const isAuthenticated = authContext.isAuthenticated; // Assuming isAuthenticated is a boolean in your AuthContext

  // If not authenticated, redirect to login page
  if (!isAuthenticated) {
    return <Navigate to="/" />;
  }

  // If authenticated, render the application
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/register" element={<Register />} />
          <Route path="/notes" element={<NotesContainer />} />
          <Route path="/notes/:noteId" element={<NotesContainer />} />
          <Route path="/404" element={<Nomatch />} />
          <Route path='*' element={<Navigate to="/404" />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
